import "./App.css";
import Loginimg from "./componetc/Loginimg";
import { Route, Routes } from "react-router-dom";
// import Log from "./componetc/Log";
import Dashbord from "./componetc/dashbord/Bord";
// import Dashbord from "./componetc/ashbord/Dashbord";

function App() {
  return (
    <>
    <switch></switch>
      <Routes>
        <Route path="/" Component={<Loginimg />} />
      </Routes>
      <Routes>
        <Route path="/Bord" Component={<Dashbord />} />
      </Routes>

      {/* <Loginimg /> */}
      {/* <Dashbord/> */}
      {/* <Log/> */}
    </>
  );
}

export default App;
